import React, {memo} from 'react';
import styled from 'styled-components';

const TitleContainerS = styled.div`
    width:100%;
    height:350px;
    background-color: #F9F9F9;
    text-align: center;
    padding-top:110px;
    color:#333;

    .title{
        display: block;
        text-align: center;
        font-size:40px;
        font-weight: 600;
        height: auto;
    }
`;

const TitleContainer = memo(() => {
  return (
    <TitleContainerS>
        <h1 className='title'>취업지원</h1>
        <p className='txt'>취업 준비생 여러분의 취업을 돕기위한 정책들을 확인해보세요.</p>
    </TitleContainerS>
  );
});

export default TitleContainer;
